<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <p>Cube of Numbers form 10 to 20</p>
    <script>
        for(let i=10; i<=20; i++){
            let cube=i*i*i;
            document.write("<br>",cube);
        }
        
    </script>
</body>
</html>
